import React, { Component } from "react";
import MenuItem from "./menuitem";
import "./NavBar.css";

class VerticalNavBar extends Component {
  state = {
    buildingView: false,
    gridView: false
  };

  handleBuilingViewClick() {
    var buildingView = !this.state.buildingView;
    console.log(buildingView);
    this.setState({ buildingView: buildingView, gridView: false });
  }

  handleGridViewClick() {
    console.log(this.state);
    let gridView = !this.state.gridView;
    this.setState({ gridView: gridView, buildingView: false });

  }

  render() {
    return (
      <React.Fragment>
        <nav
          className={
            "navbar navbar-light bg-light mr-auto float-lg-left full-h "
          }
          style={{
            borderRight: "0.5px solid #9E9E9E",
            float: "left",
            width: "132px",
            paddingLeft: "32px"
          }}
        >
          <ul className="nav nav-pills mb-auto">
            <li className="nav-item">
              <MenuItem
                isActive={this.props.buildingView}
                iconType="layer-group"
                onHandleClick={this.handleBuilingViewClick.bind(this)}
              />
            </li>
            <li className="nav-item">
              <MenuItem
                isActive={this.props.gridView}
                iconType="th-large"
                onHandleClick={this.handleGridViewClick.bind(this)}
              />
            </li>
          </ul>
        </nav>
      </React.Fragment>
    );
  }
}

export default VerticalNavBar;
